import { useEffect, useState } from "react"

const HomePage = () => {
  const [isLoading, setIsLoading] = useState(false)
  useEffect(() => {
    setTimeout(() => {
      setIsLoading(true)
    }, 3000)
    setIsLoading(false)
  }, [])

  return (
    <>
      {isLoading ? <div>Loading...</div> : <div>HomePage</div>}
    </>
  )
}

export default HomePage
